import React from "react";
import DialogflowMessenger from "./DialogflowMessenger"; // Ensure this file exists
import "./styles.css"; // Ensure styles are in a separate file

const App = () => {
  return (
    <div className="container">
      <h1>Developer Help Center</h1>
      <div className="faq">
        <h2>Frequently Asked Questions</h2>
        <ul>
          <li><a href="#">How to create a Kubernetes Cluster?</a></li>
          <li><a href="#">Jenkins Pipeline Troubleshooting</a></li>
          <li><a href="#">GKE Deployment Guide</a></li>
          <li><a href="#">Networking Issues in GCP</a></li>
        </ul>
      </div>
      <DialogflowMessenger />
    </div>
  );
};

export default App;
